import React from "react";
import { Col, Row } from "react-bootstrap";
import logo from "../../assets/logo/logo.png";

const Footer = () => {
    return (
        <div>
            <Row>
                <Col>
                    <img className="header-left_logo" src={logo} alt="" />
                </Col>
            </Row>
        </div>
    );
};

export default Footer;
